INSERT INTO `books` (`bookID`, `bookTitle`, `bookCover`, `bookWriter`, `bookOverview`, `availableStatus`, `created_at`, `updated_at`) VALUES
(1, 'Harry Potter and the Sorcererâ€™s Stone', , 'J.K. Rowling', '\"Turning the envelope over, his hand trembling, Harry saw a purple wax seal bearing a coat of arms; a lion, an eagle, a badger and a snake surrounding a large letter \'H\'.\"\r\n\r\nHarry Potter has never even heard of Hogwarts when the letters start dropping on the doormat at number four, Privet Drive. Addressed in green ink on yellowish parchment with a purple seal, they are swiftly confiscated by his grisly aunt and uncle. Then, on Harry\'s eleventh birthday, a great beetle-eyed giant of a man called Rubeus Hagrid bursts in with some astonishing news: Harry Potter is a wizard, and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin!', 1, '2024-01-05 13:35:17', '2024-01-06 20:04:17');
INSERT INTO `books` (`bookID`, `bookTitle`, `bookCover`, `bookWriter`, `bookOverview`, `availableStatus`, `created_at`, `updated_at`) VALUES
(2, 'Harry Potter and the Chamber of Secrets', , 'J.K. Rowling', 'Ever since Harry Potter had come home for the summer, the Dursleys had been so mean and hideous that all Harry wanted was to get back to the Hogwarts School for Witchcraft and Wizardry. But just as heâ€™s packing his bags, Harry receives a warning from a strange impish creature who says that if Harry returns to Hogwarts, disaster will strike.\r\n\r\nAnd strike it does. For in Harryâ€™s second year at Hogwarts, fresh torments and horrors arise, including an outrageously stuck-up new professor and a spirit who haunts the girlsâ€™ bathroom. But then the real trouble begins â€“ someone is turning Hogwarts students to stone. Could it be Draco Malfoy, a more poisonous rival than ever? Could it possibly be Hagrid, whose mysterious past is finally told? Or could it be the one everyone at Hogwarts most suspectsâ€¦ Harry Potter himself!', 0, '2024-01-05 13:35:24', '2024-01-06 11:39:25');
INSERT INTO `books` (`bookID`, `bookTitle`, `bookCover`, `bookWriter`, `bookOverview`, `availableStatus`, `created_at`, `updated_at`) VALUES
(3, 'Harry Potter and the Prisoner of Azkaban', , 'J.K. Rowling', 'Harry Potter, along with his best friends, Ron and Hermione, is about to start his third year at Hogwarts School of Witchcraft and Wizardry. Harry can\'t wait to get back to school after the summer holidays. (Who wouldn\'t if they lived with the horrible Dursleys?) But when Harry gets to Hogwarts, the atmosphere is tense. There\'s an escaped mass murderer on the loose, and the sinister prison guards of Azkaban have been called in to guard the school.', 1, '2024-01-05 13:35:34', '2024-01-06 20:04:13');
INSERT INTO `books` (`bookID`, `bookTitle`, `bookCover`, `bookWriter`, `bookOverview`, `availableStatus`, `created_at`, `updated_at`) VALUES
(4, 'Harry Potter and the Goblet of Fire', NULL, 'J.K. Rowling', 'It is the summer holidays and soon Harry Potter will be starting his fourth year at Hogwarts School of Witchcraft and Wizardry. Harry is counting the days: there are new spells to be learnt, more Quidditch to be played, and Hogwarts castle to continue exploring. But Harry needs to be careful - there are unexpected dangers lurking.', 0, '2024-01-05 14:37:12', '2024-01-06 12:02:23');
INSERT INTO `books` (`bookID`, `bookTitle`, `bookCover`, `bookWriter`, `bookOverview`, `availableStatus`, `created_at`, `updated_at`) VALUES
(5, 'Harry Potter and the Order of the Phoenix', , 'J.K. Rowling', 'Harry Potter is about to start his fifth year at Hogwarts School of Witchcraft and Wizardry. Unlike most schoolboys, Harry never enjoys his summer holidays, but this summer is even worse than usual. The Dursleys, of course, are making his life a misery, but even his best friends, Ron and Hermione, seem to be neglecting him.\r\n\r\nHarry has had enough. He is beginning to think he must do something, anything, to change his situation, when the summer holidays come to an end in a very dramatic fashion. What Harry is about to discover in his new year at Hogwarts will turn his world upside down.', 1, '2024-01-06 09:57:01', '2024-01-06 20:04:47');

